pub enum DispatcherError<E, U: Encoder<I> + Decoder, I> {
    Service(E),
    Encoder(<U as Encoder<I>>::Error),
    Decoder(<U as Decoder>::Error),
}

pub enum InOrderError<E> {

    /// Service error
    Service(E),

    /// Service call dropped
    Disconnected,
}

pub enum TimeoutError<E> {

    /// Service error
    Service(E),

    /// Service call timeout
    Timeout,
}
